package ucdiscord

import (
	"fmt"
	"log"
	"testing"

	"github.com/Implex-ltd/cleanhttp/cleanhttp"
	"github.com/Implex-ltd/fingerprint-client/fpclient"
)

var (
	F, _ = fpclient.LoadFingerprint(&fpclient.LoadingConfig{
		String:         "",
		Isbase64String: true,
	})

	H, _ = cleanhttp.NewCleanHttpClient(&cleanhttp.Config{
		BrowserFp: F,
	})

	C, _ = NewClient(&Config{
		GetCookies: true,
		Build:      227102,
		Http:       H,
	})

	Token = "MTE1MTY3NzQ2NDEwODU5NzI5OQ.G6C0R0.sM_BoN-I9bWgDevT98X54DmMqe4K2f0YhF7e7U"
)

func TestClient_Funcs(t *testing.T) {
	ws, err := NewWebsocket(Token, &XProp{
		Os:                     C.UserAgent.OSName,
		Browser:                C.UserAgent.BrowserName,
		Device:                 "",
		SystemLocale:           C.Config.Http.Config.BrowserFp.Navigator.Language,
		BrowserUserAgent:       C.Config.Http.Config.BrowserFp.Navigator.UserAgent,
		BrowserVersion:         C.UserAgent.BrowserVersion,
		OsVersion:              C.UserAgent.OSVersion,
		Referrer:               "",
		ReferringDomain:        "",
		ReferrerCurrent:        "",
		ReferringDomainCurrent: "",
		ReleaseChannel:         "stable",
		ClientBuildNumber:      C.Config.Build,
		ClientEventSource:      nil,
	})
	if err != nil {
		panic(err)
	}

	if err := ws.Login(); err != nil {
		panic(err)
	}

	C.Ws = ws

	if err := ws.UpdateStatus("dnd", "my super game"); err != nil {
		panic(err)
	}

	defer ws.Close()

	fmt.Println("fingerprint: ", C.XFingerprint)

	type args struct {
		config *Config
	}
	tests := []struct {
		name    string
		C       *Client
		args    args
		wantErr bool
	}{
		{
			name: "get_ctx_properties",
			C:    C,
		},
		{
			name: "get_properties",
			C:    C,
		},
		{
			name: "get_header",
			C:    C,
		},
		{
			name: "register",
			C:    C,
			args: args{
				config: &Config{
					Username:   "supercool",
					Invite:     "zaSphzfm",
					CaptchaKey: "nop",
				},
			},
		},
		{
			name: "join_guild",
			C:    C,
			args: args{
				config: &Config{
					Invite:   "2XvFCjm3",
					GuildID:  "1151100515778842624",
					ChannelD: "1151100515778842627",
				},
			},
		},
		{
			name: "patch_profil",
			C:    C,
			args: args{
				config: &Config{
					Bio:      "super bio",
					Pronouns: "super pronouns",
				},
			},
		},
		/*
			// lock  -> set flag 1048576 (spammer)
			{
				name: "patch_email",
				C:    C,
				args: args{
					config: &Config{
						Email:    "kryvyju784@tempmail.guru",
						Password: "SuperPass%12231$",
					},
				},
			},*/
		{
			name: "hypesquad_set",
			C:    C,
		},
		{
			name: "patch_date",
			C:    C,
			args: args{
				config: &Config{
					Date: "1999-07-07",
				},
			},
		},
		{
			name: "patch_user",
			C:    C,
			args: args{
				config: &Config{
					DisplayName: "test-name",
					Avatar:      "../examples/avatar.jpg",
				},
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(_ *testing.T) {
			switch tt.name {
			case "get_header":
				// create account
				log.Println(C.GetHeader(&HeaderConfig{
					Info: &PropInfo{
						Type: PROP_CONTEXT,
					},
					CaptchaKey:     "super_key",
					CaptchaRqtoken: "super_rq",
					Referer:        "/invite/zaSphzfm",
				}))

				// join guild
				log.Println(C.GetHeader(&HeaderConfig{
					Info: &PropInfo{
						Type: PROP_CONTEXT,
					},
					Join:      true,
					GuildID:   "1151100515778842624",
					ChannelID: "1151100515778842627",
				}))

				// add friend
				log.Println(C.GetHeader(&HeaderConfig{
					Info: &PropInfo{
						Type: PROP_CONTEXT,
					},
					Friend: true,
				}))

			case "get_ctx_properties":
				for _, loc := range []string{LOCATION_JOIN_GUILD, LOCATION_ADD_FRIEND} {
					p, err := tt.C.GetCtxProperties("guild_id_test", "channel_id_test", loc)
					if err != nil {
						fmt.Printf("%s-%s -> %v\n", tt.name, loc, err.Error())
						return
					}
					fmt.Printf("%s-%s -> %s\n", tt.name, loc, p)
				}

			case "get_properties":
				for i, infos := range []int{PROP_CONTEXT, PROP_SUPER, PROP_TRACK} {
					name, value, err := tt.C.GetProperties(&PropInfo{
						Type: infos,
					})
					if err != nil {
						fmt.Printf("get_properties-%d (%d) -> %v\n", i, infos, err.Error())
						return
					}
					fmt.Printf("get_properties-%d (%d) -> %s / %s\n", i, infos, name, value)
				}

			case "register":
				resp, data, err := tt.C.Register(tt.args.config)
				if err != nil {
					fmt.Println("register ->", err.Error())
					return
				}

				fmt.Println("register ->", resp)
				fmt.Println(data.CaptchaKey)
				fmt.Println(data.Token)

			case "patch_profil":
				tt.C.Config.Token = Token
				resp, data, err := tt.C.PatchProfil(tt.args.config)
				if err != nil {
					panic(err)
				}

				fmt.Println(resp, data)

			case "patch_email":
				tt.C.Config.Token = Token
				resp, data, err := tt.C.PatchUser(tt.args.config)
				if err != nil {
					panic(err)
				}

				fmt.Println(resp, data)
				Token = data.Token

			case "patch_user":
				tt.C.Config.Token = Token
				resp, data, err := tt.C.PatchUser(tt.args.config)
				if err != nil {
					panic(err)
				}

				fmt.Println(resp, data)
				Token = data.Token

			case "patch_date":
				tt.C.Config.Token = Token
				resp, data, err := tt.C.PatchUser(tt.args.config)
				if err != nil {
					panic(err)
				}

				fmt.Println(resp, data)
				Token = data.Token

			case "hypesquad_set":
				tt.C.Config.Token = Token
				resp, err := tt.C.JoinHypesquad(HOUSE_BRAVERY)
				if err != nil {
					panic(err)
				}

				fmt.Println(resp)

			case "join_guild":
				tt.C.Config.Token = Token
				resp, data, err := tt.C.JoinGuild(tt.args.config)
				if err != nil {
					panic(err)
				}

				fmt.Println(resp, data)
			}
		})
	}
}
